import React from 'react';
import './css/dashboard.css'
function Dashboard(){
    return (
        <div className="container">
        <div className = "row">
          <div className = "col-md-4  Dashboardcard">
            <h5>Alert</h5>
          </div>
          <h5>Threshold</h5>

          <div className = "col-md-4  Dashboardcard">
            <h5>Pressure</h5>
            <input type ="range" min="0" max="100 " className="slider"/>
            <h5>FlowRate</h5>
            <input type ="range" min="0" max="100 " className="slider"/>
            <h5>Ph Value</h5>
            <input type ="range" min="0" max="100 " className="slider"/>
          </div>
          <div className = "col-md-4  Dashboardcard">
            <h5>Number of devices connected</h5>
          </div>
        </div>
      </div>
    );
};
export default Dashboard;
